script:
reset();

const size = 96;
const maxTerrainHeight = 32;
const maxHeight = 80;
const origin = { x: size * -0.5, z: size * -0.5 };
// const seed = Math.floor(Math.random() * (2 ** 32));
// console.log(`seed: ${seed}`);
const seed = 897580047;
const simplex = new SimplexNoise(seed);

const tower = {
  origin: {
    x: -8,
    y: 0,
    z: -8,
  },
  size: {
    x: 16,
    y: 68,
    z: 16,
  },
};

const map = new Uint8Array(size * maxHeight * size);

const trunk = 3;
const leaves = 2;
const voxelNeighbors = [
  { x: 1, y: 0, z: 0 },
  { x: -1, y: 0, z: 0 },
  { x: 0, y: 0, z: 1 },
  { x: 0, y: 0, z: -1 },
  { x: 0, y: 1, z: 0 },
  { x: 0, y: -1, z: 0 },
];
const tree = (
  position,
  height,
  radius
) => {
  const branches = height + radius * 0.5;
  const queue = [position];
  while (queue.length) {
    const {
      x,
      y,
      z,
      distance = 0,
    } = queue.shift();
    if (y < 0 || y >= maxHeight) {
      return;
    }
    const isTrunk = distance < height;
    update(origin.x + x, y, origin.z + z, (isTrunk || distance < branches) ? trunk : leaves);
    const pushNeighbor = (offset) => {
      const nx = x + offset.x;
      const ny = y + offset.y;
      const nz = z + offset.z;
      if (
        nx >= 0 && nx < size
        && nz >= 0 && nz < size
        && !map[nx * size * maxHeight + ny * size + nz]
      ) {
        queue.push({
          x: nx,
          y: ny,
          z: nz,
          distance: distance + 1,
        });
        return true;
      }
      return false;
    };
    if (isTrunk) {
      pushNeighbor({ x: 0, y: 1, z: 0 });
    } else if (distance === height) {
      voxelNeighbors.forEach((offset) => {
        if (offset.y !== -1) {
          pushNeighbor(offset);
        }
      });
    } else if (distance < (height + radius)) {
      let count = 0;
      const neighbors = voxelNeighbors.length;
      for (let i = 0; i < neighbors; i += 1) {
        const neighbor = voxelNeighbors[
          Math.floor(
            Math.abs(simplex.noise3D((x + i) * 2, (y - i) / 2, (z + i) * 2)) * neighbors
          )
        ];
        if (pushNeighbor(neighbor)) {
          count += 1;
          if (count >= 2) {
            break;
          }
        }
      }
    }
  }
};

const center = size * 0.5 - 0.5;
for (let x = 0; x < size; x += 1) {
  for (let y = 0; y < maxTerrainHeight; y += 1) {
    for (let z = 0; z < size; z += 1) {
      const sd = (center - x) ** 2 + (center - z) ** 2;
      const top = Math.min(size * Math.exp(
        -(sd) / ((size - 16) * 12)
      ), size * 0.5 - Math.sqrt(sd));
      const height = Math.floor(
       (
          Math.abs(simplex.noise3D(x / 32, y / 24, z / 32)) * 0.3
          +  Math.abs(simplex.noise3D(x / 64, y / 48, z / 64)) * 0.3
          +  Math.abs(simplex.noise3D(x / 128, y / 64, z / 128)) * 0.4
        ) * top
      );
      map[x * size * maxHeight + y * size + z] = y < height;
    }
  }
}

for (let x = 0; x < size; x += 1) {
  for (let y = 0; y < maxHeight; y += 1) {
    for (let z = 0; z < size; z += 1) {
      if (map[x * size * maxHeight + y * size + z]) {
        const top = (
          (
            (origin.x + x) < tower.origin.x
            || (origin.x + x) >= (tower.origin.x + tower.size.x)
            || (origin.z + z) < tower.origin.z
            || (origin.z + z) >= (tower.origin.z + tower.size.z)
          ) && (
            y === (maxHeight - 1)
            || !map[
              x * size * maxHeight + (y + 1) * size + z
            ]
          )
        );
        const type = top ? 1 : 4;
        if (top && y > 2 && simplex.noise3D(x / 8, y / 4, z / 8) > 0.6) {
          if (simplex.noise3D(y / 8, x / 4, z / 8) > -0.5) {
            update(origin.x + x, y + 1, origin.z + z, 5);
          } else {
            const n = Math.abs(simplex.noise2D(z / 8, x / 8));
            const h = 5 + Math.floor(Math.abs(simplex.noise2D(x / 2, z / 2)) * 16);
            const r = 7 + Math.floor(n * h * 0.5);
            tree({x, y, z}, h, r);
          }
        }
        update(origin.x + x, y, origin.z + z, type);
      }
    }
  }
}

// main structure
sphere(
  tower.origin.x + tower.size.x * 0.5 - 1,
  tower.origin.y + tower.size.y,
  tower.origin.z + tower.size.z * 0.5 - 1,
  tower.size.x * 0.9,
  (x, y, z) => y >= (tower.origin.y + tower.size.y) ? 6 : 0
);
sphere(
  tower.origin.x + tower.size.x * 0.5 - 1,
  tower.origin.y + tower.size.y,
  tower.origin.z + tower.size.z * 0.5 - 1,
  tower.size.x * 0.7,
  0
);

box(
  tower.origin.x, tower.origin.y, tower.origin.z,
  tower.size.x, tower.size.y, tower.size.z,
  6
);

// mid stair section
box(
  tower.origin.x,
  tower.origin.y + tower.size.y * 0.5 - 1,
  tower.origin.z,
  tower.size.x, 1, tower.size.z,
  0
);
box(
  tower.origin.x + 1,
  tower.origin.y + tower.size.y * 0.5 - 1,
  tower.origin.z + 1,
  tower.size.x - 2, 1, tower.size.z - 2,
  7
);
box(
  tower.origin.x,
  tower.origin.y + tower.size.y * 0.5,
  tower.origin.z,
  tower.size.x, 4, tower.size.z,
  0
);
box(
  tower.origin.x + tower.size.x * 0.5 - 4,
  tower.origin.y + tower.size.y * 0.5,
  tower.origin.z + tower.size.z * 0.5 - 4,
  8, 4, 8,
  6
);
for (let i = 0; i < 6; i += 1) {
  const y = tower.origin.y + tower.size.y * 0.5 + 4 + i;
  box(
    tower.origin.x,
    y,
    tower.origin.z,
    tower.size.x, 1, tower.size.z,
    0
  );
  const s = i + 1;
  box(
    tower.origin.x + tower.size.x * 0.5 - 4 - s,
    y,
    tower.origin.z + tower.size.z * 0.5 - 4 - s,
    8 + s * 2, 1, 8 + s * 2,
    7
  );
}

// top section
box(
  tower.origin.x - 4,
  tower.origin.y + tower.size.y - 2,
  tower.origin.z - 4,
  tower.size.x + 8, 2, tower.size.z + 8,
  7
);
box(
  tower.origin.x,
  tower.origin.y + tower.size.y - 1,
  tower.origin.z,
  tower.size.x, 1, tower.size.z,
  0
);
box(
  tower.origin.x - 3,
  tower.origin.y + tower.size.y - 3,
  tower.origin.z + 1,
  tower.size.x + 6, 3, tower.size.z - 2,
  0
);
box(
  tower.origin.x + 1,
  tower.origin.y + tower.size.y - 3,
  tower.origin.z - 3,
  tower.size.x - 2, 3, tower.size.z + 6,
  0
);

cylinder(
  tower.origin.x - 6,
  tower.origin.y + tower.size.y - 1,
  tower.origin.z + tower.size.z * 0.5 - 1,
  'x', 4, tower.size.z + 12,
  0
);
cylinder(
  tower.origin.x + tower.size.x * 0.5 - 1,
  tower.origin.y + tower.size.y - 1,
  tower.origin.z - 6,
  'z', 4, tower.size.x + 12,
  0
);

box(
  tower.origin.x + tower.size.x * 0.5 - 6,
  tower.origin.y + tower.size.y - 4,
  tower.origin.z + tower.size.z * 0.5 - 6,
  12, 1, 12,
  0
);
box(
  tower.origin.x + tower.size.x * 0.5 - 5,
  tower.origin.y + tower.size.y - 5,
  tower.origin.z + tower.size.z * 0.5 - 5,
  10, 1, 10,
  0
);
